    const double lc8 = lua_objlen(L, 1);
    lua_pushnumber(L, lc8);
    lua_pushnumber(L, 1);
    lc_add(L, -2, -1);
    lua_remove(L, -2);
    lua_remove(L, -2);
    lua_insert(L, -2);
    lua_settable(L, 1);
    assert(lua_gettop(L) - lc_nextra == 4);

    /* internal: stack cleanup on scope exit */
    lua_pop(L, 2);
    lc3_var += lc5_step;
